import React from "react";
import {BrowserRouter, Route, Routes, Navigate} from 'react-router-dom';
import OfficerDashboard from "./components/OfficerDashboard";
import OfficerLogin from "./components/OfficerLogin";
import OfficerSignup from "./components/OfficerSignup";
import  { isAuthenticated } from "./services/authService";

function App() {
  return (
    <div className="App">
     <BrowserRouter>
     <Routes>
      <Route path="/signup" element={<OfficerSignup/>}/>
      <Route path="/login" element={<OfficerLogin/>}/>
      <Route path="/dashboard" element={isAuthenticated() ? <OfficerDashboard/> : <Navigate to="/login"/>}/>
      <Route path="/" element={<Navigate to="/login" />}/>
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
